INSERT INTO `szolgaltatas` (`id`, `nev`, `leiras`, `kepfajl`) VALUES
(1, 'Porszívózás', 'Általában 2 munkanap alatt vállaljuk gépi gyártású szőnyegek (normál rövidszőrű, hosszúszőrű shaggy szőnyegek) sík-mélymosását, faliszőnyegek, rongyszőnyegek, gyapjűszőnyegek egyedi mosását, valamint kézi csomózású szőnyegek, kézi szőttes szőnyegek és keleti szőnyegek egyedi mosását, vagy kézi tisztítását, valamint antik szőnyegek kézi tisztítását!', ),
(2, 'Ablaktisztítás', 'Mindenki szeret tisztán látni, de elfáradni annál kevésbé.\r\nKollégáink a napi rutinnak megfelelően, szakszerűen és gyorsan végzik munkájukat. Az ablak és üvegfelületek tisztításánál a legkorszerűbb technológiákat és vegyszereket használjuk, legyen szó modern, vagy régi ablakokról az eredmény tartós és szép lesz.\r\nAz ablaktisztítás során a keretek takarításáért nem számolunk fel külön árat.', ),
(3, 'Vasalás', 'A vasalás rendkívül idő és energia igényes. Egy nagyobb mosás esetén akár 3-4 órát is igénybe vehet a textíliák vasalása. Bizonyos ruhaneműknél speciális eszközökkel lehet csak végrehajtani. Minden tisztítási szolgáltatás tartalmazza a vasalást. Így nyújtva teljes körű megoldást a ruhatisztításra fokozva az Ön kényelmét. Válassza Ön is a teljes körű tisztítási szolgáltatásunkat! Fordítsa idejét fontosabb dolgokra!', ),
(4, 'Mosás', 'A ruhákat kis kapacitású gépeken jó minőségű környezetkímélő mosószerekkel és adalékanyagokkal mossuk. Mindvégig szem előtt tartjuk a textília jellemzőit és ennek megfelelően választjuk ki, a használt mosószereket, illetve a mosás és szárítás hőmérsékletét. Az alapos mosás után gondos kézi vasalás következik, amely során minden apró gyűrődést igyekszünk kisimítani. Az elkészült textíliákat higiénikus csomagolásban tároljuk és adjuk át tulajdonosaiknak.', );
INSERT INTO `szolgaltatas` (`id`, `nev`, `leiras`, `kepfajl`) VALUES
(5, 'Nagytakarítás', 'Egy átlagos háztartásban évente kétszer ajánlott a nagytakarítást megejteni. Nagyjából ez a 6 hónap az az időintervallum, ami alatt összegyűlik annyi por és szennyeződés a lakásban aminek a száműzéséhez már egy általános takarítás kevés. Nem csak a szabadon álló helyeket portalanítjuk le és töröljük tisztára, mint a napi (rutin) takarítás alkalmával, hanem minden tárgyat, bútort elmozdítunk a helyéről és alatta is, mögötte is kitakarítunk. Könyves polcok esetében lepakoljuk a polc teljes tartalmát (könyveket és a polcon található többi tárgyat), a könyveket leportalanítjuk, a csecsebecséket áttöröljük, majd a szekrény minden oldalát (beleértve a tetejét, alját és az összes polcot) megtisztítjuk.', );
INSERT INTO `szolgaltatas` (`id`, `nev`, `leiras`, `kepfajl`) VALUES
(6, 'Általános takarítás', 'Ha keveset volt otthon a héten, és egy hosszú munkanap után néha az utolsó dolog amit tenni akarunk, hogy körbe takarítsuk a lakást. De mi készségesen segítségedre leszünk a takarításban, így neked csak élvezned kell a csodás tisztaságot, amit magunk után hagyunk.', );

